import React from "react";

function Home1(props) {
    return(
        <div className="box">
            <img src="https://picsum.photos/100" />
            <p> Name : {props.name} </p>
            <p> Position : {props.position} </p>
            <p> Website : {props.website} </p>
        </div>
    );
}

export default Home1;
